    @Test
    void limitValuesTest() {
        //найменше значення
        assertFibonacciEquals(0, "0");
        //сусідні значення
        assertThrowsInvalidInputException(-1);
        assertFibonacciEquals(1, "1");

        //найбільше значення n = 191367
        assertFibonacciEquals(191367, "");
        //сусідні значення
        assertFibonacciEquals(191366, "");
        assertFibonacciEquals(191368, "");
    }

